        if d == 1:
            blk = M[self.tM1]
            tM1_inv = [16, 31, 32, 63, 48, 75, 0, 91, 71, 30, 79, 62, 87, 74, 95, 90, 70, 23, 78, 55, 86, 73, 94, 89, 5, 22, 21, 54, 37, 72, 53, 88, 8, 15, 24, 47, 40, 67, 56, 83, 69, 14, 77, 46, 85, 66, 93, 82, 68, 7, 76, 39, 84, 65, 92, 81, 61, 6, 13, 38, 29, 64, 45, 80]
